          "message": "migrate to mostly a100 labels (#60)\n\nSUMMARY:\r\n* switch to mostly using the a100's in NIGHTLY\r\n* switch to using combination of a100's and h100's for \"remote push\"\r\n* patch ENV skip mechanism for a number of files\r\n* add two new ENV for test directories `prompt_adapter` and `multimodal`\r\n* add ENV skipping mechanism for test files in the base level of `tests`\r\ndirectory. this ENV is `SMOKE`.\r\n* add `neuralmagic/tests/test_skip_env_vars/debug.txt` that should skip\r\nall tests.\r\n* add CUDA capability \"skip if\" for a couple of tests.\r\n\r\nTEST PLAN:\r\nruns on remote push. will manually trigger a NIGHTLY relative to this\r\nbranch.\r\n\r\n---------\r\n\r\nCo-authored-by: andy-neuma <andy@neuralmagic.com>",
